function Projects() {
    return(
        <section className="projects">
            <h2>Projects</h2>
            <ul>
                <li>A Number Guessing Game</li>
                <li>Blog App</li>
                <li>To-Do App</li>
            </ul>
        </section>
    );
}

export default Projects;
